import React from "react";
import "../BookingsControls/BookingsControls.css"

const bookingsControl = props => {
  return (
    <div className="bookings-control">
      <button onClick={props.changeOutput.bind(this, 'list')}>List</button>
      <button onClick={props.changeOutput.bind(this, 'chart')}>Chart</button>
    </div>
  )
}

export default bookingsControl;
